('0ca5fd99-01d9-41ad-8d6e-9a2c482ee740', 'Phòng Học Cho Thuê Giá Rẻ Quận Tân Phú', '0', 'PQTP', 'Địa chỉ: 68 Trần Quang Cơ, Phường Phú Thạnh, Quận Tân Phú, Hồ Chí Minh', '2cb8fc16-b963-4ac3-a18f-07a7291c6fc8', 'CTMB', '[\"Chúng tôi có phòng học sạch sẽ và thoáng đãng đang cần cho thuê. Dưới đây là một số thông tin chi tiết:\",\"Địa chỉ: CN1: 68 Trần Quang Cơ, Phú Thạnh, Tân Phú\",\"CN2: 89 Trần Quang Cơ, Phú Thạnh, Tân Phú\",\"Diện tích phòng: khoảng 30m²\",\"Tiện nghi: Phòng đã được trang bị cửa sổ lớn, máy lạnh, bảng, bàn ghế đầy đủ tiện nghi\",\"Giá thuê: Chỉ từ 900-1 triệu đồng/tháng, đã bao gồm phí dịch vụ.\"]', '5b79aeea-20fb-4661-a91f-79af9da5ed03', '303beeed-5aed-495b-bda5-b0da8cf28bfa', 'a3bce0a8-0a08-4dad-92b0-83db8e18c014', 900000.00, 30, '2024-07-09 09:53:23', '2024-07-09 09:53:23'),
('10a198d5-14b9-4f48-ba3d-7348a37c0e62', 'Cho thuê nhà nguyên căn 4 ngủ, mới đẹp,Quận Thanh xuân', '2', 'NQTX', 'Địa chỉ: Cự Lộc, Phường Thượng Đình, Quận Thanh Xuân, Hà Nội', 'f22aff17-09fd-4f75-9fb7-27828eb3465c', 'NCT', '[\"Cho thuê nhà nguyên căn trong ngõ nhỏ yên tĩnh và an toàn, ở phố Cự Lộc gần Ngã Tư Sở và cũng gần Trung Hoà Nhân Chính. Diện tích 50m2, 3 tầng 1 tum\",\"tầng 1: phòng khách, bếp, 1 vệ sinh\",\"tầng 2 và 3: mỗi tầng 2 phòng ngủ và 1 nhà vệ sinh -tắm (tổng 2 nhà vệ sinh-tắm và thêm 1 nhà vệ sinh riêng ở tầng 1)\",\"tầng 4 : tum, sân phơi, góc cà phê, trồng cây. Bạn nào yêu cây thì tha hồ trồng hoa.\",\"có đủ đồ dùng cần thiết bếp, xoong nồi, máy giặt, tủ lạnh, tv ở phòng khách, điều hoà lạnh, giường tủ...Camera khu vực chung ở tầng 1 bắt buộc sử dụng.\",\"Ngay sau Royal city, gần các trường đại học, cách ĐH KHXNNV, ĐH KHTN 1,2Km, ĐH Hà Nội 2,7Km, tiện đường xe bus, tàu trên cao đến ĐH Kiến trúc, bưu chính, Phenikaa,\",\"Cách ĐH Công đoàn, ĐH Thuỷ lợi, Ngoại Thương, Ngoại Giao…\"]', 'bf5e5c9e-1842-432b-ab8c-e0ebc2858338', '5905ade4-1f45-4d1b-848b-18ea8ac69154', '04a059af-f024-430b-a2c9-949ceef89f32', 12500000.00, 50, '2024-07-09 09:51:43', '2024-07-09 09:51:43'),
('16d90e4b-6d1f-4107-b604-1255c50ac0ea', 'Mặt bằng đẹp cho thuê đường Tân Sơn Nhì,Q.Tân Phú – (ở lại được, KD tự do hoặc mở Văn Phòng)', '0', 'PQTP', 'Địa chỉ: 26/42 Tân Sơn Nhì, Phường Tân Sơn Nhì, Quận Tân Phú, Hồ Chí Minh', '907de3d1-9be4-4f8b-b156-83e6fa87f2a1', 'CTMB', '[\"+ Mặt bằng cho thuê đường xe hơi Tân Sơn Nhì, Quận Tân Phú (Rất đông người qua lại – tiện kinh doanh online hay mọi ngành nghề hoặc mở văn phòng)\",\"+ Diện tích: 3 x 10m, có phòng riêng ở lại bên trong, mặt bằng kinh doanh nhỏ bên ngoài, WC riêng.\",\"+ Gần nhiều siêu thị, chợ, chung cư, gần nhiều tòa cao ốc văn phòng, công ty, nhiều trường đại học, bệnh viện và nhiều địa điểm như:Gần siêu thị Pandora City, ETown Cộng Hòa, chợ Võ Thành Trang (Bà Quẹo), tiện đi lại mọi nơi trong thành phố.\",\"+ Nhà mặt tiền đường trong khu dân cư sầm uất, rất đông người qua lại, ở và làm việc.\",\"+ Là nơi lý tưởng để ở và kinh doanh online và các ngành nghề hoặc mở văn phòng.\",\"- Địa chỉ: 26/42 Tân Sơn Nhì, Phường Tân Sơn Nhì, Quận Tân Phú (- Đường nối giữa Tân Sơn Nhì và Tân Kỳ Tân Quý – Gần chợ Võ Thành Trang Bà Quẹo).\",\"Giá giảm chỉ còn: 5 triệu/tháng. (Giá cũ: 6 Triệu/tháng – Giảm giá và giữ ổn định không tăng giá sau này tạo điều kiện thuận cho khách kinh doanh)\",\"Liên hệ: 0937554570 (A.Hoàng) (Liên hệ ngay để giữ mặt bằng).\",\"Từ Khoá: mặt bằng cho thuê quận Tân Phú, cho thuê mặt bằng quận Tân Phú Tân Bình, mặt bằng giá rẻ cho thuê, mặt bằng giảm giá cho thuê quận tân bình tân phú.\"]', '80b7cde5-7d43-4483-907e-66b0448dad24', '49628cba-b915-4771-ae94-f2545b23e84d', '22cab763-3778-494c-8bf0-53dbaa3e0ff1', 5000000.00, 30, '2024-07-09 09:53:23', '2024-07-09 09:53:23'),
