('a0053cdd-cd65-4e1b-a274-e3ae6922852a', 'Chính chủ sang nhà làm căn hộ dịch vụ, Trần Khánh Dư, P.Tân Định, Q1', '0', 'TNQ1', 'Địa chỉ: Đường Trần Khánh Dư, Phường Tân Định, Quận 1, Hồ Chí Minh', 'f2ec6ac4-2b37-4693-b06f-7fd17d1e3272', 'NCT', '[\"Chính chủ cần sang:\",\"Nhà làm CHDV hẻm Trần Khánh Dư , P.Tân Định , Q.1\",\"- Diện tích : 4 x 15 ( nhà chữ L )\",\"- Kết cấu : 1 trệt 3 lầu.\",\"- Bao gồm : 7 phòng - 7 toilet.\",\"- Các phòng có nội thất, cửa sổ thoáng...\",\"- Giá thuê : 20tr /tháng.\",\"- Nếu full khách ,lợi nhuận lời nét 17tr /tháng.\",\"- Giá sang 299tr bao gồm : cọc chủ 40tr + chi phí đầu tư, sửa chữa...\",\"- Không bao gồm cọc khách.\",\"- HĐ với chủ nhà còn dài hạn 5,5 năm.\",\"LH: 0948100993 Khánh (Zalo)\"]', '0c9f8830-deda-4b61-9544-4ca06494e5fa', '5a0cc225-5a11-45bf-a25b-ead20734ec59', '62f80808-6937-4d6d-b1f5-8791af852241', 20000000.00, 60, '2024-07-09 09:51:44', '2024-07-09 09:51:44');
