('a240b56f-6063-4549-aff9-5afa8f91d2a0', 'Phòng đầy đủ nội thất ngay trung tâm quận 3 - Ngã 6 Cộng Hòa', '3', 'PTQ3', 'Địa chỉ: 549/ Nguyễn Đình Chiểu, Phường 2, Quận 3, Hồ Chí Minh', '81dc6b66-c442-4cc1-a3e1-0e5cfaff2a4f', 'CTPT', '[\"⭐ VỊ TRÍ:\",\"Nhà tọa lạc tại vị trí đẹp Nguyễn Đình Chiểu (2 chiều) thông ra ngay Nguyễn Thiện Thuật, gần vòng xoay Cộng Hòa, thuận tiện qua các quận trung tâm: chỉ vài bước chân là trung tâm quận 1, chỉ mất 5 phút lái xe là đến Phố tây Bùi Viện, 5-10 phút để di chuyển qua quận 4, 5, 8, 10.\",\"Gần các trung tâm thương mại lớn như Now Zone, Vạn Hạnh Mall, các trường Đại Học lớn như ĐH Sài Gòn, ĐH Khoa Học Tự Nhiên, ĐH Sư Phạm,Cao Đẳng Kinh Tế Đối ngoại…\",\"Xung quanh bán kính 0.5-1km là nhiều cửa hàng tiện lợi (Ministop, FamilyMart), Chợ Bàn Cờ, cửa hàng, shop thời trang, ăn uống, cà phê,...\",\"⭐ NỘI THẤT:\",\"️ Giường.\",\"️ Nệm, Drap\",\"️ Tủ Lạnh\",\"️ Máy Lạnh\",\"️ Tủ Quần Áo\",\"️ Bàn, Ghế Làm Việc.\",\"Các dịch vụ MIỀN PHÍ:------------------------------------------------------------------------------------------\",\"* Toilet trang bị máy nước nóng (MIỄN PHÍ) ( thời tiết có lạnh cũng không sao).\",\"* Máy giặt (MIỄN PHÍ) Sân phơi rộng cho bạn phơi quần áo, hóng gió\",\"* Đặc biệt nhà có khu bếp riêng, sử dụng điện MIỄN PHÍ\",\"* Chỗ để xe trong nhà, KHÔNG TỐN PHÍ\",\"-------------------------------------------------------------------------------------------------------------------------\",\"Camera an ninh 24/24 (Khu nhà xe và khu vực chung)\",\"Dọn vệ sinh hàng tuần (khu vực chung)\",\"Giờ giấc tự do, không chung chủ\",\"⭐ Giá thuê phòng 3TR9 đến 4tr5\",\"Địa chỉ: Hẻm Ba Gác 549 Nguyễn Đình Chiểu, Phường 2, Quận 3.\",\"(Hẻm xe hơi rẻ vào vài bước chân)\",\"Liên hệ xem phòng: 0962 42 42 61\"]', 'e8e47a92-bd83-4dfc-897c-21993793ee1d', 'd42bb869-6e40-4175-9187-f8361e2dcf07', 'd377def2-6824-46a7-b134-c002facb5a5b', 3900000.00, 15, '2024-07-09 09:49:41', '2024-07-09 09:49:41'),
('a4f7939a-b8f5-4ae9-8d6e-e319c70637d0', 'Chính chủ cần cho thuê nhà nguyên căn 1 trệt, 1 lầu, 2 mặt tiền: 2pn, 3wc, 1 pshc, 1 pk, 1 bếp: 12tr/th', '0', 'TNTD', 'Địa chỉ: Đường số 3, Phường Trường Thọ, Thủ Đức, Hồ Chí Minh', '6ed49b33-489f-473b-951b-7adc10c622af', 'NCT', '[\"Nhà nguyên căn 2 MẶT TIỀN: 1 TRỆT, 1 LẦU, gần KDC Trường Thịnh (KDC Công Đoàn) sạch sẽ, an ninh (nhà 4x15) 2 PHÒNG NGỦ, 3 WC, 1 PHÒNG KHÁCH, 1 PHÒNG SINH HOẠT CHUNG, 1 BẾP. (ƯU TIÊN KHÁCH THIỆN CHÍ THUÊ DÀI HẠN: TỐI THIỂU 2 NĂM)\",\"Các tiện ích:\",\"1. Nhà 2 mặt tiền: đường trước nhà 8m, hẻm bên hông 4m, cách Công viên chỉ 2p đi bộ,\",\"2. Khu dân cư cán bộ công chức (an ninh),\",\"3. Thuận tiện buôn bán kinh doanh, đậu đỗ xe hơi thoải mái.\",\"4. Cách ga Metro ngã 4 Thủ đức chỉ 5p.\",\"5. Gần Ngã 4 Thủ Đức\"]', 'e7e71547-3321-474a-a91d-f2cff948a1d9', '0d69ee2c-34f1-4b31-b6ab-1565a3aa266d', '54abb045-b613-4dd2-be6e-ac8fe16a3a5c', 12000000.00, 180, '2024-07-09 09:51:44', '2024-07-09 09:51:44'),
