('e36b620e-165f-41c6-8d42-22a58e6543d2', 'Mặt bằng đẹp cho thuê đường Tân Sơn Nhì,Q.Tân Phú – (ở lại được, KD tự do hoặc mở Văn Phòng)', '0', 'PQTP', 'Địa chỉ: 26/42 Tân Sơn Nhì, Phường Tân Sơn Nhì, Quận Tân Phú, Hồ Chí Minh', '9fc0bfab-309c-4f79-8ae5-9511e2cf806f', 'CTMB', '[\"+ Mặt bằng cho thuê đường xe hơi Tân Sơn Nhì, Quận Tân Phú (Rất đông người qua lại – tiện kinh doanh online hay mọi ngành nghề hoặc mở văn phòng)\",\"+ Diện tích: 3 x 10m, có phòng riêng ở lại bên trong, mặt bằng kinh doanh nhỏ bên ngoài, WC riêng.\",\"+ Gần nhiều siêu thị, chợ, chung cư, gần nhiều tòa cao ốc văn phòng, công ty, nhiều trường đại học, bệnh viện và nhiều địa điểm như:Gần siêu thị Pandora City, ETown Cộng Hòa, chợ Võ Thành Trang (Bà Quẹo), tiện đi lại mọi nơi trong thành phố.\",\"+ Nhà mặt tiền đường trong khu dân cư sầm uất, rất đông người qua lại, ở và làm việc.\",\"+ Là nơi lý tưởng để ở và kinh doanh online và các ngành nghề hoặc mở văn phòng.\",\"- Địa chỉ: 26/42 Tân Sơn Nhì, Phường Tân Sơn Nhì, Quận Tân Phú (- Đường nối giữa Tân Sơn Nhì và Tân Kỳ Tân Quý – Gần chợ Võ Thành Trang Bà Quẹo).\",\"Giá giảm chỉ còn: 5 triệu/tháng. (Giá cũ: 6 Triệu/tháng – Giảm giá và giữ ổn định không tăng giá sau này tạo điều kiện thuận cho khách kinh doanh)\",\"Liên hệ: 0937554570 (A.Hoàng) (Liên hệ ngay để giữ mặt bằng).\",\"Từ Khoá: mặt bằng cho thuê quận Tân Phú, cho thuê mặt bằng quận Tân Phú Tân Bình, mặt bằng giá rẻ cho thuê, mặt bằng giảm giá cho thuê quận tân bình tân phú.\"]', '40457f11-37b9-44fb-8fa9-dae374cd37dc', '4632c876-caba-4f2c-b5c5-5a57e1679e27', '3c159468-ee51-4898-a09d-3ad97f1ec7bf', 5000000.00, 35, '2024-07-09 09:53:23', '2024-07-09 09:53:23'),
