('f2897417-de1d-4b07-a16c-f274b2894f10', 'Siêu phẩm căn hộ Duplex mới 100% đủ nội thất – 179 Lê Đình Thám, P.Tân Quý, Q.Tân Phú. (Ngay Aeon Mall – Luỹ Bán Bích)', '0', 'VQTP', 'Địa chỉ: 179 Đường Lê Đình Thám, Phường Tân Quý, Quận Tân Phú, Hồ Chí Minh', 'a0f50175-b7a6-49fc-80a2-7f5a5524f97e', 'CTCH', '[\"Tôi có toà nhà mới xây hiện cho thuê phòng thiết kế dạng Căn Hộ Studio Duplex mới 100% với nội thất và thang máy nguyên tem chưa bóc seal gồm: 01 tầng trệt và 01 Gác Lửng thiết kế riêng, siêu đẹp với cầu thang gỗ và sàn gỗ tự nhiên khu bếp nấu ăn riêng và cửa sổ rộng rãi, có phòng có view Ban Công.\",\"+ DT: 20m2 – 30m2: Trong phòng có đầy đủ các tiện nghi thiết kế chuẩn khách sạn cao cấp – dịch vụ tuyệt vời:\",\"- Máy Lạnh inverter mới 100% đảm bảo siêu tiết kiệm điện.\",\"- Tủ bếp gỗ hiện đại với tủ bếp trên và tủ bếp dưới, có bồn rửa chén tiện lợi cho bạn nấu những bữa ngon.\",\"- Khu giặt đồ với 3 máy giặt và 3 máy sấy lồng ngang cao cấp dùng miễn phí.\",\"- Nhà vệ sinh dễ thương có bồn rửa mặt, gương và đủ thiết bị vệ sinh cao cấp.\",\"- Tủ áo hiện đại.\",\"- Tủ Lạnh 2 ngăn lớn, tiết kiệm điện năng.\",\"- Bàn ăn hoặc bàn làm việc xinh xắn cho bạn.\",\"- Ra vào bằng cửa vân tay.\",\"- Hệ thống phòng cháy chữa cháy, báo cháy đầy đủ, an toàn.\",\"- Nhà để xe rộng rãi, sang trọng, đường lớn ô tô tới tận nhà rất thuận tiện.\",\"- Hệ thống camera, đảm bảo an ninh từng phòng,\",\"- Ưu đãi ngập tràn cho khách chek in thuê đầu tiên và thuê lâu dài !!!\",\"- Khu dân cư an ninh, yên tĩnh, an ninh lịch sự, tiện ích ngập tràn cách bạn vài bước chân dạo bộ.\",\"- VỊ TRÍ THUẬN LỢI: Hẻm 179 Lê Đình Thám, P.Tân Quý, sát bên Aeon Mall Tân Phú, gần khu bàn cờ sầm uất: Vườn Lài, Tân Hương, Luỹ Bán Bích, Lạc Long Quân…. Tiện di chuyển mọi nơi trong thành phố với nhiều tuyến đường không kẹt xe.\",\"Giá siêu tốt mùa khai trương chỉ từ: 3.5 Triệu – 4.5 Triệu – 5 Triệu/tháng. (Cam kết không tăng giá)\",\"- Địa chỉ: 179/7/33 Lê Đình Thám, P.Tân Quý, Q.Tân Phú (Ngay gần giao lộ Luỹ Bán Bích – Gò Dầu – Tân Hương, cạnh Aeon Mall, Celadon City)\",\"- Liên Hệ: 0937554570 (A.Hoàng) – Hẹn gặp bạn tại chính căn phòng tuyệt vời này\"]', '7952305d-6db2-4faf-aef2-b82fff9a6da8', '27f03a5b-3923-4f1a-9762-cebd2b4e1f99', 'bbd2ca96-26ba-4c0d-ab82-7df22108b6d0', 4000000.00, 30, '2024-07-09 09:52:54', '2024-07-09 09:52:54'),
('f3f47311-a8b7-40db-9a76-62366b516d39', 'Cho thuê nhà nguyên căn Phan Văn Trị Gò Vấp gần khu Cityland', '2', 'NQGV', 'Địa chỉ: Đường Phan Văn Trị, Phường 10, Quận Gò Vấp, Hồ Chí Minh', '58eef182-9abc-476e-a960-325d1b083057', 'NCT', '[\"Cho thuê nhà 50m², đường xe hơi 1 sẹc Phan Văn Trị gần chợ Gò Vấp, HCMC.\",\"Nhà 1 trệt gồm 2 PN, 1 WC, pk, bếp, sân để xe..\",\"Vị trí 1 sẹc đường Phan Văn Trị gần chợ Gò Vấp. Đường xe hơi, tiện ích đầy đủ.\",\"Giá thuê chỉ 4triệu / tháng. Đặt cọc 1 tháng. Hợp đồng 1 năm.\"]', '2da1697e-1f6c-4dc0-a7ed-610eafd32c7e', '050af941-e515-492c-bbab-50ab060385da', 'a450b86f-099e-41b3-8d32-e449fdffd836', 4000000.00, 50, '2024-07-09 09:51:43', '2024-07-09 09:51:43'),
