('f522f01c-eca7-4fd7-92eb-700e711ed81e', 'Chính chủ cho thuê căn hộ mini cao cấp tại Cầu Giấy, Hà Nội', '5', 'MQCG', 'Địa chỉ: Nhà 46A, Ngách 28/260 Đường Cầu Giấy, Phường Quan Hoa, Quận Cầu Giấy, Hà Nội', '973a67b1-2fc1-43de-9ef9-b15880304b74', 'CTCH', '[\"Cho Thuê Căn Hộ Mini Cao Cấp tại Cầu Giấy, Hà Nội\",\"Vị trí đắc địa ở Nhà 46A, Ngách 28/260 Cầu Giấy, Hà Nộ, đi bộ ra chợ, bến xe buýt, cách Ga tàu trên cao chùa Hà khoảng 100m, gần các trường Đại học Báo chí Tuyên truyền, ĐH Quốc gia, Giao thông\",\"Giá cả hấp dẫn: Giá phòng chỉ từ 4,5 triệu/tháng - 6 triệu.\",\"Phòng nào cũng có ban công thoáng sáng\",\"Nội thất đầy đủ: Giường đôi, Tủ quần áo có mắc treo bằng nhựa cao cấp, Máy giặt ,Tủ lạnh, Điều hòa, Bếp từ, Ấm siêu tốc, Tủ bếp trên dưới, Bộ xoong nồi 3 cỡ + chảo chống dính, rổ và thau rửa rau, dao, Thớt làm bằng tre ép.... tất cả mới nguyên.\",\"Phí dịch vụ bao gồm: Điện 3.7k/số, Nước: 30k/khối, Internet cáp quang cực nhanh: 100k/phòng\",\"Dịch vụ tiện ích chỉ 100k/người (bao gồm bảo vệ, vệ sinh, máy giặt, đổ rác...)\",\"Chỗ đậu xe máy: Miễn phí cho 2 xe đầu, từ xe thứ 3 chỉ 100k/tháng\",\"Bạn chỉ cần xách va ly đến ở, mọi thứ đã sẵn sàng!\",\"Liên hệ Anh Sâm: c\",\" \"]', '4e8b2158-0ce8-4c6d-abef-9e9afab110bd', 'd2babaf2-a087-42da-a3a9-e7e78a04a10a', 'c7fabc0a-90a7-4d18-a0aa-723c928669b8', 4500000.00, 18, '2024-07-09 09:52:53', '2024-07-09 09:52:53'),
('f94c1d64-62c5-44f2-b469-bf5a03c279d4', 'Cho thuê PHÒNG DẠY HỌC GIÁ RẺ Q.TÂN PHÚ', '0', 'PQTP', 'Địa chỉ: 68 Đường Trần Quang Cơ, Phường Phú Thạnh, Quận Tân Phú, Hồ Chí Minh', 'eb5a1150-afc0-41ed-94dd-7da7c79c4738', 'CTMB', '[\"Cho thuê PHÒNG DẠY HỌC GIÁ RẺ Q.TÂN PHÚ\",\"Khung giờ thuê linh động: 7H30 – 21H mỗi ngày.\",\"Phòng học sức chứa đến 30HS, thoáng mát - rộng rãi - sạch sẽ.\",\"Cơ sở vật chất tiện nghi (máy lạnh, bảng, phấn, khăn, nước uống, vệ sinh, giữ xe – MIỄN PHÍ).\",\"Vị trí mặt tiền đường rộng rãi, gần TH Phan Chu Trinh, THCS Đồng Khởi, THCS Thoại Ngọc Hầu, THPT Trần Phú....\",\"Địa chỉ:\",\"CN1: 68 Trần Quang Cơ, Phú Thạnh, Tân Phú\",\"CN2: 89 Trần Quang Cơ, Phú Thạnh, Tân Phú\",\"Chi tiết liên hệ 0918.757.943 (Zalo)\"]', '276468aa-0934-48d2-ab50-14f56ffca9d2', '07702569-b876-4873-8d6d-b3bcabb7d4a2', '4b5235e8-bae2-4260-b5eb-7a330fbdbd8e', 900000.00, 30, '2024-07-09 09:53:23', '2024-07-09 09:53:23'),
('ff3d2d5f-3c72-49da-8506-0af2cc20e876', 'Cho thuê phòng Trọ khu bầu cát Tân bình', '3', 'TQTB', 'Địa chỉ: 228/2 Đường Nguyễn Hồng Đào, Phường 14, Quận Tân Bình, Hồ Chí Minh', 'de9db351-570a-4b2b-b55f-0d751fd1c878', 'CTPT', '[\"Cho thuê phòng khu bầu cát ,vi trí cách chợ bầu cát 200 , cách ngã ba Âu cơ và nguyễn Hồng đào 200m ,đi quận 10 mất 10p , khu vực giao thông thuận tiện đi lại các quận ko sợ kẹt xe\",\"Phòng, có bếp nấu máy lạnh máy giặt vệ sinh trong phòng , có cửa sổ rộng thoáng mát, có gác ,tủ quần áo ,giường nệm\",\"Giờ giấc tự do , gửi xe miễn phí giá 3,5tr/tháng cho khách thiện chí , dễ thương thuê nhanh gọn\",\"Địa chỉ : 228/2 Nguyễn Hồng Đào ,p14 , Tân bình . 0974131709\"]', 'c1e73897-8f38-49fd-9666-cfcf1f6eaacb', 'e7cbd895-a38d-40dd-b63c-dcef3f9aba0b', '19400681-3e74-4a36-b304-5dd2fbf130ba', 3500000.00, 40, '2024-07-09 09:49:41', '2024-07-09 09:49:41'),
